  },[])


  //Get weather
  const getWeather = async () => {
    await fetch(`https://api.openweathermap.org/data/2.5/weather?lat=${userLocation.lat}&lon=${userLocation.lon}&appid=8bd04b4c4bc8f493a35b227dba34ae78`)
      .then(response => response.json())
      .then(data => console.log(data))
  }



  return (
    <div>
      <h1>Weather app</h1>
      <h2>{userLocation.latitude}</h2>
    </div>
  );
}

